import React from "react";
//import SongListTestB from "./components/SongListTestB";
import WeatherAPI from "./components/WeatherAPI";
import "./styles.css";



class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <WeatherAPI />
        </header>
      </div>
    );
  }
}

export default App;
